import React, { useEffect, useState } from "react";
import Paginacao from './Paginacao';
import Navbar from './NavBar';
import Cadastro from './Cadastro';
import { BrowserRouter as Router } from 'react-router-dom';


function PaginaInicial() {

    const [usuarios, setUsuarios] = useState('')

    useEffect(()=>{
        fetch("http://localhost:8080/usuario/getAll")
        .then( res => res.json())
        .then((resultado)=>{
            setUsuarios(resultado)
        })
    })


  return (
    <div>
    {/* ---------------------------- NavBar ------------------------------- */}
    <div> 
      <nav className="relative flex flex-wrap items-center justify-between px-2 py-3 bg-cyan-500 mb-3">
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
          <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
            <a className="text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-nowrap uppercase text-white"  href="#nada" >
              API REST
            </a>
          </div>
        </div>
      </nav>
      <Paginacao/>
      </div>
      {/* ------------------------------- Lista e busca ------------------------------------------ */}
    

{/*       <Paginacao/>
    <Cadastro/> */}
    </div>
  );
}

export default PaginaInicial;
